import React from "react";
import { Button } from "react-bootstrap";


const ReadOnlyRow = ({ contact, handleEditClick, handleDeleteClick }) => {
  return (
    <>
      <tr className="row">
        <td className="col-4 text-truncate">{contact.fullName}</td>
        <td className="col-4 text-truncate">{contact.address}</td>
        <td className="col-4 d-flex justify-content-end btnFild">
          <Button
            className="mr-1 btn-sm btn-secondary"
            type="button"
            onClick={(event) => handleEditClick(event, contact)}
          >
            Edit
          </Button>

          <Button type="button" className="btn-sm btn-secondary" onClick={() => handleDeleteClick(contact.id)}>
            Delete
          </Button>
        </td>
      </tr>
    </>
  );
};

export default ReadOnlyRow;
